import React, { useRef } from "react";
import "./BlogPosts.css";
import TopBar from "../TopBar/TopBar";
import { motion, useScroll } from "framer-motion";

function BlogPosts() {

  function count () {
    var i = 0;
    return ( () => { 
      console.log(i); 
      i += 1})
  }

